sys_variable_value.value:
(function execute(inputs, outputs) {

  var voda_gr = new GlideRecord('x_821227_vodafon_0_vodafonetable');
  voda_gr.addQuery('status', '=', inputs.status);
  voda_gr.query();

  while(voda_gr.next())
  {
    var dump_gr = new GlideRecord('x_821227_vodafon_0_vodafonedumptable');
    dump_gr.initialize();
    dump_gr.dump_emailaddress = inputs.emailaddress;
    dump_gr.dump_number = inputs.number;
    dump_gr.dump_status = inputs.status;
    dump_gr.dump_surname = inputs.surname;
    dump_gr.dump_givenname = inputs.given_name;

    var dump_insert = dump_gr.insert();

    if(dump_insert){
      voda_gr.deleteRecord();
    }

  }

})(inputs, outputs);

